import { useState } from 'react';
import Letter from './Letter';

function GameRow() {
    const [word, setWord] = useState("test");

    return (
        <div className='game-row'>
            {Array.from(word).map((char, index) => (
                <Letter key={index} char={char} state={index % 2 + 1} />
            ))}
        </div>
    );
}

export default GameRow;
